import { useEffect, useState } from "react";
import DataProvider from "../services/DataProvider";

const SerbiaData = () => {
  const [data, setData] = useState([]);
  useEffect(() => {
    const getData = async () => {
      const data = DataProvider.getSerbiaData();
      setData(data);
    };
    getData();
  }, []);
  return (
    <div>
      <h4>Serbia Graph here</h4>
      <p>{data}</p>
    </div>
  );
};

export default SerbiaData;
